	shouldComponentUpdate(nextProps) {
		if (nextProps.src !== this.props.src) {
			console.log("nextProps.src !== this.props.src")
			return true
		} else {
			return false
		}
	}

	render() {
		return <ReactSVG {...this.props} />
	}
}

export default svg
